!function($){class FPAdminSettings{constructor(){this.initEvents()}initEvents(){$("#mtg_fp_key_type").on("change",(()=>this.toggleGlobalAccess())),$("#mtg_encryption_method").on("change",(()=>this.toggleEncryptionMethod())),this.toggleGlobalAccess(),this.toggleEncryptionMethod()}toggleGlobalAccess(){"personal"===$("#mtg_fp_key_type").val()?$("#global_access_row").show():$("#global_access_row").hide()}toggleEncryptionMethod(){"recaptcha"===$("#mtg_encryption_method").val()?($(".recaptcha_row").show(),$(".turnstile_row").hide()):"turnstile"===$("#mtg_encryption_method").val()?($(".turnstile_row").show(),$(".recaptcha_row").hide()):($(".recaptcha_row").hide(),$(".turnstile_row").hide())}}$(document).ready((function(){new FPAdminSettings}))}(jQuery);